import React from "react"

function Defination(){
    const usernames = ["Pedro","Mike", "Nike", "Jessica","Kim"]

return(
    <div>
        {/* ARRAY MAPPING  */}

        {/* {usernames.map((element,key)=>{
            return <h2>{element}</h2>
        })} */}

        {/* FOReach Method */}

        {usernames.forEach(items => {
            return <h1>{items}</h1>
        })}
    </div>
)
}

export default Defination
